(function(){

	var fonts = [{
		base64: '',
		family: 'Benton Sans',
		weight: '400',
		style: 'normal'
	}, {
		base64: '',
		family: 'Benton Sans',
		weight: '700',
		style: 'normal'
	}, {
		base64: '',
		family: 'Benton Sans',
		weight: '400',
		style: 'italic'
	}];

	// add this to local storage
	localStorage.setItem('fonts', JSON.stringify(fonts));

	if (EB.customFontsEnabled) {
		// if the page hasnt taken too long to load then render the fonts
		EB.renderFonts(fonts);
	}

})();